Sociopolitical Documentary hosted by Harry Wallop, published by Channel 4 broadcasted as part of CH4 Dispatches series in 2014 - English narration


Information
------------------------------

Supermarket Wars
Food retailing is undergoing its greatest revolution since supermarkets were invented. The era of domination by the big four - Tesco, Sainsbury's, Morrisons and Asda - is waning. Profits are slumping, sales are stalling, and online shopping is transforming the market. And while the big four struggle, discounters such as Aldi and Lidl are booming.
Channel 4 Dispatches investigates what went wrong, and is still going wrong, and reveals the tricks of Aldi and Lidl's success. The supermarkets are fighting back with an aggressive price war, claiming to have slashed the prices of thousands of everyday items.
But can we trust them? Harry Wallop finds that, while there are some savings, other 'special offers' aren't what they're cracked up to be.

